import React from 'react';
import { PowerBIEmbed } from 'powerbi-client-react';
import { models } from 'powerbi-client';

const PowerBIReport: React.FC = () => {
    const embedConfig = {
        type: 'report',   // Supported types: report, dashboard, tile, visual and qna
        id: 'fc2c4aab-5572-4b75-bd66-41d2c905f0ba',
        embedUrl: "https://app.powerbi.com/reportEmbed?reportId=fc2c4aab-5572-4b75-bd66-41d2c905f0ba&groupId=caa3de24-afde-47a4-b310-828066d88e6e&w=2&config=eyJjbHVzdGVyVXJsIjoiaHR0cHM6Ly9XQUJJLVdFU1QtRVVST1BFLXJlZGlyZWN0LmFuYWx5c2lzLndpbmRvd3MubmV0IiwiZW1iZWRGZWF0dXJlcyI6eyJ1c2FnZU1ldHJpY3NWTmV4dCI6dHJ1ZX19",
        accessToken: 'eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsIng1dCI6Ik1jN2wzSXo5M2c3dXdnTmVFbW13X1dZR1BrbyIsImtpZCI6Ik1jN2wzSXo5M2c3dXdnTmVFbW13X1dZR1BrbyJ9..GD-RD7uHm1lDNRacHK2L0vVLUC4RMzZO3FEgq_HH4LEAP-haNIBCAzEYddu48dg9tB2KLYyf12DUVJwyEYq5Z5-gc5XoeL6Aw8hzm9F2XUljJ7DQf3Pp6Cl-W_jiU2LW0FGP-tLn50CBDST9vRk7W7WkqDAd4LDbNncdUXamQqnc1kt-RJtcYFnEN4l-R8c9aGKGAPHYPMi8ArhwQLeXoBX5ggpLKtc0hpHwWJ1VhwV2ys38YQyvrfRpKCj4EmPVRAvGSTdIDsqzi1bSaNjzGxn_wtrLwR_M-_d-hXEOQ-a1VYIHercwCbT6G2s-hCMANjdUTn-54z9byMBFmBlVxQ',
        tokenType: models.TokenType.Aad,
        settings: {
            panes: {
                filters: {
                    visible: false
                },
                pageNavigation: {
                    visible: false
                }
            }
        }
    };

    return (
        <div style={{ height: '100vh' }}>
            <PowerBIEmbed
                embedConfig={embedConfig}
                cssClassName="embedded-report"
                getEmbeddedComponent={(embeddedReport) => {
                    console.log('Embedded Report:', embeddedReport);
                }}
            />
        </div>
    );
};

export default PowerBIReport;
